	@Test
	public void test_given_PodsInfoResponse_returns_ClassificationByCenterComponentNameAndColor() {

        def pods = new JsonSlurper().parseText(podsJson)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')
        assert podsStatus.podsStatus.toString() == '[AZ1:[blue:[arqrun2:[[podId:arqrun2-b-7f48846bbc-sqvnk, ready:true]]], green:[demoarqcbk3:[[podId:demoarqcbk3-g-84c56f6b96-g9nzp, ready:true]]]], AZ2:[blue:[arqrun2:[[podId:arqrun2-b-66b84874bf-zmrw8, ready:true]]], green:[demoarqcbk3:[[podId:demoarqcbk3-g-6c7844dbc4-pv6lz, ready:true]]]]]', 'We did not get the expected ICPPodsStatus'

    }

    @Test
    public void test_given_PodsInfoResponseAndRemovalOfArqrun2_returns_ClassificationByCenterComponentNameAndColorButArqrun2NotPresent() {

        def pods = new JsonSlurper().parseText(podsJson)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')
        assert podsStatus.removeComponent('AZ1', 'blue', 'arqrun2') == [[podId:'arqrun2-b-7f48846bbc-sqvnk', ready:true]], 'We did not get the expected pod'
        assert podsStatus.podsStatus.toString() == '[AZ1:[blue:[:], green:[demoarqcbk3:[[podId:demoarqcbk3-g-84c56f6b96-g9nzp, ready:true]]]], AZ2:[blue:[arqrun2:[[podId:arqrun2-b-66b84874bf-zmrw8, ready:true]]], green:[demoarqcbk3:[[podId:demoarqcbk3-g-6c7844dbc4-pv6lz, ready:true]]]]]', 'We did not get the expected ICPPodsStatus'

    }

    @Test
    public void test_given_PodsInfoResponseWithANonReadyPod_returns_TheNotReadyPod() {

        String jsonWithNotReadyPod = podsJson.replace(
            '{"name":"arqrun2-b-7f48846bbc-sqvnk","status":{"creationTimestamp":"2021-04-29T10:59:36Z","name":"arqrun2-b-7f48846bbc-sqvnk","ready":true},"restarts":0}',
        '{"name":"arqrun2-b-7f48846bbc-sqvnk","status":{"creationTimestamp":"2021-04-29T10:59:36Z","name":"arqrun2-b-7f48846bbc-sqvnk","ready":false},"restarts":0}')

        def pods = new JsonSlurper().parseText(jsonWithNotReadyPod)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')
        assert podsStatus.getNotReadyPod('AZ1', 'blue', 'arqrun2') == 'arqrun2-b-7f48846bbc-sqvnk', 'We did not get the expected podId'

    }

    @Test
    public void test_given_PodsInfoResponseAndRequestingSinglePod_returns_ThatPod() {

        def pods = new JsonSlurper().parseText(podsJson)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')
        assert podsStatus.findPod('arqrun2-b-7f48846bbc-sqvnk') == [podId:'arqrun2-b-7f48846bbc-sqvnk', ready:true], 'We did not get the expected pod'

    }

    @Test
    public void test_given_PodsInfoResponseAndDeletingSinglePod_returns_DeletionOfThatPod() {

        def pods = new JsonSlurper().parseText(podsJson)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')
        assert podsStatus.removePod('arqrun2-b-7f48846bbc-sqvnk') == true, 'We did not get the expected pod'
        assert podsStatus.podsStatus.toString() == '[AZ1:[blue:[arqrun2:[]], green:[demoarqcbk3:[[podId:demoarqcbk3-g-84c56f6b96-g9nzp, ready:true]]]], AZ2:[blue:[arqrun2:[[podId:arqrun2-b-66b84874bf-zmrw8, ready:true]]], green:[demoarqcbk3:[[podId:demoarqcbk3-g-6c7844dbc4-pv6lz, ready:true]]]]]', 'We did not get the expected ICPPodsStatus'

    }

    @Test
    public void test_given_PodsInfoResponseAndAskingForOrderedList_returns_ListOfPodsWithNonConsecutiveComponentNames() {

        def pods = new JsonSlurper().parseText(podsJson)
        ICPPodsStatus podsStatus = new ICPPodsStatus(pods, ['demoarqcbk3', 'arqrun2'], 'DEV')   //This is just to create the object. We'll overwrite its content
        podsStatus.podsStatus = [AZ1:[green:[arqrun2:[[podId:'arqrun2-g-7f48846bbc-sqvnk', ready:true], [podId:'arqrun2-g-66b84874bf-zmrw8', ready:true]], demoarqcbk3:[[podId:'demoarqcbk3-g-84c56f6b96-g9nzp', ready:true], [podId:'demoarqcbk3-g-6c7844dbc4-pv6lz', ready:true]]]]]
        def orderedPods = podsStatus.orderPodsWithNonConsecutiveComponentName('AZ1', 'green')
        assert orderedPods == [[componentName:'arqrun2', podId:'arqrun2-g-66b84874bf-zmrw8'],[componentName:'demoarqcbk3', podId:'demoarqcbk3-g-6c7844dbc4-pv6lz'],[componentName:'arqrun2', podId:'arqrun2-g-7f48846bbc-sqvnk'],[componentName:'demoarqcbk3', podId:'demoarqcbk3-g-84c56f6b96-g9nzp']], 'We did not get the pods in the expected order'

    }

